import React from 'react'
import {Octicons} from '@expo/vector-icons';
export default function SignOut() {
    function onSignOut(){
        console.log("sign out");
        return
    }
    return (
        <div onClick ={onSignOut}>
            <button></button><Octicons  name = "sign-out" size = {22} color = {'white'}/>
        </div>
    )
}
